import React from 'react'
import "./styles/Home.css"

export default function Home({isOpen}) {

  let hour = new Date().getHours()
  let name = " Philip"
  let greeting = ""
  let sessionObj = {header: "Styrka", day: "M책ndag", time: "12:30"}


  if (hour < 10) {
      greeting = "God morgon";
  } else if (hour >= 10 && hour < 14) {
      greeting = "God middag";
  } else if (hour >= 14 && hour < 18) {
      greeting = "God eftermiddag";
  } else if (hour >= 18 && hour < 23) {
      greeting = "God kv채ll";
  }



  return (
    <div className="home-wrapper" style={{ filter: isOpen ? "brightness(50%)" : "blur(0) brightness(100%)" }}>

      <div className="greeting">
        <h1> {greeting}, {name}</h1>
      </div>
      <div className="sessions-header">
       <h3>Dagens pass</h3>
      </div>
      <div className="sessions">
        <h2>{sessionObj.header}</h2>
        <h2>{sessionObj.day} {sessionObj.time}</h2>
      </div>

    </div>
  )
}
